import { dummy } from '../dummy';
import { Question } from './Question';

export const Questions = () => {
    return (
        <div>
            <ul>
                {dummy.map((post) => {
                    return (
                        <Question key={post.id} dummy={post.title} ></Question>
                    )
                })}
            </ul>
        </div>
    )
};
